import React from "react";
import { Row, Col, Form, Stack } from "react-bootstrap";

const DateTime = () => {
  return (
    <Row>
      <Col sm={5} md={8} lg={3}>
        <Stack direction="horizontal" gap={3}>
          <Form
            className="d-flex justify-content-center"
            style={{ fontFamily: "primary-font" }}
          >
            <Form.Group>
              <Form.Control size="lg" type="date" style={{marginBottom: "1rem",
                    padding: "1.5rem",}}/>
            </Form.Group>
            <Form.Group>
              <Form.Control size="lg" type="time" />
            </Form.Group>
          </Form>
        </Stack>
      </Col>
    </Row>
  );
};

export default DateTime;
